(508, 1, 'property', '{\"name\":\"Casa alto padr\\u00e3o para venda em S\\u00e3o Louren\\u00e7o  - MG.\",\"slug\":\"casa-alto-padrao-em-sao-lourenco-a-venda\",\"slug_id\":\"472\",\"is_slug_editable\":\"1\",\"model\":\"Srapid\\\\RealEstate\\\\Models\\\\Property\",\"type\":\"sale\",\"is_featured\":\"1\",\"description\":null,\"content\":\"<p>Casa de Alto Padr\\u00e3o com 270m\\u00b2 em Localiza\\u00e7\\u00e3o Privilegiada<\\/p><p>Apresentamos essa magn\\u00edfica casa de alto padr\\u00e3o, com 270 metros quadrados de puro luxo e conforto. Ideal para quem busca sofistica\\u00e7\\u00e3o e qualidade de vida, esse im\\u00f3vel oferece:<\\/p><p>Sala de 2 Ambientes: Perfeita para recepcionar com eleg\\u00e2ncia, integrada de maneira fluida aos demais espa\\u00e7os da casa.<br>3 Su\\u00edtes Internas: Sendo uma delas com hidromassagem, proporcionando um ambiente exclusivo de relaxamento e bem-estar.<br>1 Banheiro Social: Com acabamentos de alto padr\\u00e3o, atendendo com estilo e funcionalidade.<br>1 Su\\u00edte Externa de 60m\\u00b2: Com total privacidade, ideal para h\\u00f3spedes ou para quem busca um espa\\u00e7o separado.<br>Sauna: Perfeita para momentos de descontra\\u00e7\\u00e3o e relaxamento.<br>Piscina e Ducha: Uma \\u00e1rea para lazer completa, perfeita para os dias mais quentes.<br>\\u00c1rea Gourmet Completa: Com fog\\u00e3o a lenha, churrasqueira e forno de pizza, para celebrar momentos inesquec\\u00edveis com amigos e fam\\u00edlia.<br>Sal\\u00e3o Vers\\u00e1til: Um grande sal\\u00e3o que pode ser utilizado tanto para festas quanto para jogos, atendendo \\u00e0s suas necessidades de divers\\u00e3o e conviv\\u00eancia.<br>Vaga para at\\u00e9 3 Carros: Com amplo espa\\u00e7o de garagem para acomodar com conforto e seguran\\u00e7a seus ve\\u00edculos.<br>Esse im\\u00f3vel \\u00e9 a combina\\u00e7\\u00e3o perfeita de sofistica\\u00e7\\u00e3o, conforto e lazer, em uma das melhores localiza\\u00e7\\u00f5es. N\\u00e3o perca a oportunidade de viver com o luxo e a qua