(18, 'Loteamento de Chácaras Belas Colinas', '<p>Cansado da correria da cidade?<br>Chegou sua chance de viver em meio à natureza sem abrir mão do conforto.</p><p>✨ O que você vai encontrar:<br>• Terrenos nobres de 2.000m²<br>• Vista deslumbrante da Serra da Mantiqueira<br>• Clima perfeito o ano todo<br>• 20 minutos do centro de São Lourenço<br>• Ar puro e qualidade de vida</p><p>🏡 Infraestrutura completa:<br>• Água encanada<br>• Energia elétrica<br>• Internet fibra ótica<br>• Ruas abertas<br>• Escritura garantida</p><p>💎 Investimento inteligente:<br>• Entrada facilitada<br>• Parcelas a partir de R$ 999<br>• Financiamento direto<br>• Aceitamos seu veículo<br>• Pronto para construir</p><p>🌿 Ideal para:<br>• Sua casa de campo<br>• Investimento com alta valorização<br>• Refúgio de fim de semana<br>• Morar em meio à natureza</p><p>Venha conhecer pessoalmente esse paraíso!<br>📱 Fale agora com Rodrigo Lima: (35) 98815-1468\"</p><p>&nbsp;</p><p><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/19.jpg\" alt=\"19\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/18.jpg\" alt=\"18\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/17.jpg\" alt=\"17\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/16.jpg\" alt=\"16\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/15.jpg\" alt=\"15\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/14.jpg\" alt=\"14\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/13.jpg\" alt=\"13\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/12.jpg\" alt=\"12\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/10.jpg\" alt=\"10\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/9.jpeg\" alt=\"9\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/8.jpeg\" alt=\"8\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/7-1.jpg\" alt=\"7-1\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/7.jpeg\" alt=\"7\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/6-1.jpg\" alt=\"6-1\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/6.jpeg\" alt=\"6\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/5.jpeg\" alt=\"5\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/4.jpeg\" alt=\"4\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/3.jpeg\" alt=\"3\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/2.jpeg\" alt=\"2\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/belas-colinas/fotos-3d/1.jpeg\" alt=\"1\"><br>&nbsp;</p>', '{\"1\":\"imoveis\\/belas-colinas\\/logo-png.png\",\"2\":\"belas-colinas\\/fotos\\/fb9cf05ed90c434b89f5e22c091fa6e9.jpg\",\"3\":\"belas-colinas\\/fotos\\/fbdb47dfc0b24bb9be5a213ded34740e.jpg\",\"4\":\"belas-colinas\\/fotos\\/e5385732cfe14c76b7e951346032fce3.jpg\",\"5\":\"belas-colinas\\/fotos\\/f42e77f3d8064665b57a36d48702e56d.jpg\",\"6\":\"belas-colinas\\/fotos\\/dd9448e0fa76436fad2b39436b31993a.jpg\",\"7\":\"belas-colinas\\/fotos\\/de68d40b155b463b983b0240d83f6aa7.jpg\",\"8\":\"belas-colinas\\/fotos\\/d0c5734816b3482c9a14ea76cc17b6da.jpg\",\"9\":\"belas-colinas\\/fotos\\/da44a753fb7f450288c6588ea8f9e04a.jpg\",\"10\":\"belas-colinas\\/fotos\\/b37929e78f424ecda876f1b814418850.jpg\",\"11\":\"belas-colinas\\/fotos\\/c30aa6c2f2d04d4f851823bf26097685.jpg\",\"12\":\"belas-colinas\\/fotos\\/aa05ee536bbf498aa041c0b27fa837d0.jpg\",\"13\":\"belas-colinas\\/fotos\\/b54bc1981a1742b2b1d243caad3d2f27.jpg\",\"14\":\"belas-colinas\\/fotos\\/5843f8ca0cb1484da48260ba2e183111.jpg\",\"15\":\"belas-colinas\\/fotos\\/22673905f82e47629a56edb7f6f0c