(19, 'Residencial Villágio San Marina', '<p><strong>Aproveite a Oportunidade de Adquirir Seu Novo Lar!</strong></p><p>🏡 <strong>Apartamentos a partir de 64m²</strong> com <strong>2 quartos</strong> (sendo 1 suíte) perfeitos para você e sua família!<br>🔑 <strong>Sala e cozinha americana integradas</strong>, oferecendo mais espaço e praticidade no seu dia a dia.<br>🚗 <strong>Vaga coberta na garagem</strong> para sua comodidade e segurança.</p><p>E tem mais!<br>🛝 <strong>Playground</strong> para a diversão das crianças e uma <strong>Área Gourmet</strong> ideal para reunir amigos e família.<br>🌟 <strong>Localização privilegiada</strong>, a poucos minutos do <strong>Trem das Águas</strong>, com acesso rápido a todos os pontos essenciais da cidade.</p><p>Não perca essa chance de viver com conforto, praticidade e segurança em um dos melhores lugares da cidade! Entre em contato agora e agende sua visita!</p>', '{\"1\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0036.jpg\",\"2\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0034.jpg\",\"3\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0019.jpg\",\"4\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0020.jpg\",\"5\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0021.jpg\",\"6\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0022.jpg\",\"7\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0023.jpg\",\"8\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0024.jpg\",\"9\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0025.jpg\",\"10\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0026.jpg\",\"11\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0027.jpg\",\"12\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0028.jpg\",\"13\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0029.jpg\",\"14\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0030.jpg\",\"15\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0033.jpg\",\"16\":\"empreendimentos\\/residencial-villagio-marina\\/imagem-do-whatsapp-de-2025-02-24-as-123802-0f5a393f.jpg\",\"17\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0031.jpg\",\"18\":\"empreendimentos\\/residencial-villagio-marina\\/img-20250224-wa0032.jpg\"}', 'Estação', NULL, 4, 40, 1, '2025-08-27', '2025-03-04', 'selling', '2025-03-04 19:16:36', '2025-03-21 22:42:20', 0, NULL, 345000, 399000, 1, 6, NULL, 'Srapid\\ACL\\Models\\User', '22.110422', '45.049186', 8),
(20, 'Villa Romana', '<p>Villa Romana</p>', '{\"1\":\"empreendimentos\\/villa-romana\\/img-20250304-wa0042.jpg\",\"2\":\"empreendimentos\\/villa-romana\\/img-20250304-wa0043.jpg\",\"3\":\"empreendimentos\\/villa-romana\\/img-20250304-wa0041.jpg\",\"4\":\"empreendimentos\\/villa-romana\\/img-20250304-wa0039.jpg\",\"5\":\"empreendimentos\\/villa-romana\\/img-20250304-wa0040.jpg\",\"6\":\"empreendimentos\\/villa-romana\\/img-20250304-wa0036.jpg\",\"7\":\"empreendimentos\\/villa-romana\\/img-20250304-wa0037.jpg\",\"8\":\"empreendimentos\\/villa-romana\\/img-20250304-wa0038.jpg\",\"9\":\"empreendimentos\\/villa-romana\\/img-20250304-wa0033.jpg\",\"10\":\"empreendimentos\\/villa-romana\\/img-20250304-wa0035.jpg\",\"11\":\"empreendimentos\\/villa-romana\\/img-20250304-wa0032.jpg\"}', 'Rodovia BR 460', NULL, NULL, NULL, 1, '2026-01-31', '2025-03-04', 'selling', '2025-03-04 22:57:15', '2025-03-22 00:16:40', 0, NULL, 71900, 389000, 1, 8, NULL, 'Srapid\\ACL\\Models\\User', '-22.134130', '-45.095615', 14),
(21, 'Residencial Vivendas Boulevard', '<p><strong>🌟 Seu Novo Lar Espera por Você no Residencial Vivendas Boulevard! 🌟</strong></p><p>🏡 <strong>Apartamentos Modernos de 1, 2 e 3 Quartos em um Local Privilegiado!</strong></p><p>Se você busca conforto, praticidade e modernidade em um só lugar, o <strong>Residencial Vivendas Boulevard</strong> é o seu destino! Com apartamentos de alto padrão e uma infraestrutura completa, você e sua família terão tudo o que precisam para viver com qualidade de vida, em um ambiente seguro, sofisticado e repleto de comodidades.</p><p>🌟 <strong>Destaques do Imóvel:</strong></p><ul><li><strong>Apartamentos de 1, 2 e 3 Quartos</strong>: Ambientes modernos e bem planejados para atender todas as necessidades da sua família.</li><li><strong>Áreas de Lazer Completas</strong>: Piscina, academia, espaço pet e muito mais para garantir o seu lazer e bem-estar.</li><li><strong>Roof Top</strong>: Um espaço exclusivo para você aproveitar uma vista incrível e momentos de descontração.</li><li><strong>Call Work</strong>: Um ambiente perfeito para quem precisa de um espaço tranquilo e funcional para trabalhar em casa.</li><li><strong>Porteiro Eletrônico e Segurança</strong>: A tranquilidade que você merece, com toda a segurança e praticidade.</li></ul><p>💎 <strong>Viva com Modernidade e Conforto no Vivendas Boulevard!</strong> 💎<br>O <strong>Residencial Vivendas Boulevard</strong> oferece a combinação perfeita de lazer, conforto e segurança, com a praticidade de uma localização estratégica, ideal para quem busca qualidade de vida e bem-estar para toda a família.</p><p>📞 <strong>Agende sua visita e venha conhecer seu novo lar! Não perca a chance de viver em um dos condomínios mais completos da cidade!</strong></p><p>&nbsp;</p><p>&nbsp;</p>', '{\"1\":\"imoveis\\/vivendas-boulevard\\/sem-titulo.png\",\"2\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0025.jpg\",\"3\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0024.jpg\",\"4\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0022.jpg\",\"5\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0023.jpg\",\"6\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0021.jpg\",\"7\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0019.jpg\",\"8\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0020.jpg\",\"9\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0018.jpg\",\"10\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0017.jpg\",\"11\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0015.jpg\",\"12\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0016.jpg\",\"13\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0014.jpg\",\"14\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0013.jpg\",\"15\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0011.jpg\",\"16\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0012.jpg\",\"17\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0010.jpg\",\"18\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0009.jpg\",\"19\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0007.jpg\",\"20\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0008.jpg\",\"21\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0006.jpg\",\"22\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0004.jpg\",\"23\":\"imoveis\\/vivendas-boulevard\\/img-20240905-wa0005.jpg\"}', 'Centro', NULL, NULL, NULL, 1, '2026-01-31', '2025-03-01', 'selling', '2025-03-09 16:57:52', '2025-03-22 00:16:31', 0, NULL, 419000, 799000, 1, 6, NULL, 'Srapid\\ACL\\Models\\User', '-22.119387', '-45.056005', 12),
(22, 'Loteamento Residencial Parque da Mata', '<p><img src=\"https://rodrigolimanegimob.com.br/storage/empreendimentos/parque-da-mata/imagem-do-whatsapp-de-2025-03-11-as-213514-380e0f25.jpg\" alt=\"Imagem do WhatsApp de 2025-03-11 à(s) 21.35.14_380e0f25\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/empreendimentos/parque-da-mata/imagem-do-whatsapp-de-2025-03-11-as-213514-6fa24e60.jpg\" alt=\"Imagem do WhatsApp de 2025-03-11 à(s) 21.35.14_6fa24e60\"><br><img src=\"https://rodrigolimanegimob.com.br/storage/empreendimentos/parque-da-mata/1.jpg\" alt=\"1\"><br>&nbsp;</p>', '{\"1\":\"empreendimentos\\/parque-da-mata\\/parque-da-mata-1.png\"}', 'Parque da Mata', NULL, NULL, NULL, 0, '2025-07-31', '2025-03-01', 'selling', '2025-03-12 21:24:43', '2025-03-21 22:42:51', 0, NULL, 100000, 160000, 1, 6, NULL, 'Srapid\\ACL\\Models\\User', '-22.107503', '-45.071411', 1);
