(65, 'Apartamentos em São Lourenço MG Villagio San Marina', '<p><strong>Aproveite a Oportunidade de Adquirir Seu Novo Lar!</strong></p><p>🏡 <strong>Apartamentos a partir de 64m²</strong> com <strong>2 quartos</strong> (sendo 1 suíte) perfeitos para você e sua família!<br>🔑 <strong>Sala e cozinha americana integradas</strong>, oferecendo mais espaço e praticidade no seu dia a dia.<br>🚗 <strong>Vaga coberta na garagem</strong> para sua comodidade e segurança.</p><p>E tem mais!<br>🛝 <strong>Playground</strong> para a diversão das crianças e uma <strong>Área Gourmet</strong> ideal para reunir amigos e família.<br>🌟 <strong>Localização privilegiada</strong>, a poucos minutos do <strong>Trem das Águas</strong>, com acesso rápido a todos os pontos essenciais da cidade.</p><p>Não perca essa chance de viver com conforto, praticidade e segurança em um dos melhores lugares da cidade! Entre em contato agora e agende sua visita!</p>', 'Estação', '{\"1\":\"accounts\\/img-3176-2.PNG\",\"2\":\"accounts\\/7f4ff2d5-8c9b-4901-8def-4dec9c831808-1.jpg\",\"3\":\"accounts\\/1861a3ea-8f71-4b97-94d5-55e3cf4147a8-1.jpg\",\"4\":\"accounts\\/1f71b066-9c54-4cd4-9945-1e12f6bc4c8f-1.jpg\",\"5\":\"accounts\\/e6136bb6-b7fb-4953-a8fa-f90c1cf32cd0-1.jpg\",\"6\":\"accounts\\/4c26358a-03b9-4367-98ff-aa04904fe1771-1.jpg\",\"7\":\"accounts\\/adc382db-ae63-4ec2-b571-0b26f4961048-1.jpg\",\"8\":\"accounts\\/b9b4ced1-2e23-4074-a883-7dfdc07f9db71-1.jpg\",\"9\":\"accounts\\/c7d07571-2716-493f-a3c4-d6fde35578bf1-1.jpg\",\"10\":\"accounts\\/c7d07571-2716-493f-a3c4-d6fde35578bf-1.jpg\",\"11\":\"accounts\\/e17351a6-20b1-4f76-aa90-6ed244606a34-1.jpg\",\"12\":\"accounts\\/f03c7b5f-ce06-41c0-8f20-dce49be0b8c1-1.jpg\",\"13\":\"accounts\\/f08b1faf-2e9a-4f07-885e-395d679d06b91-1.jpg\"}', 0, 2, 2, 6, 64, 350000.00, NULL, 0, 'selling', '2025-03-04 13:18:02', '2025-03-21 18:11:52', 'sale', NULL, 1, 6, 'day', 16, 'Srapid\\RealEstate\\Models\\Account', 'approved', '2025-04-18', 0, 1, '22.110422', '45.049186', 19),
(68, 'Apartamento de alto padrão para venda em São Lourenço - MG.', '<p><strong>Viva o Luxo e Conforto em um Apartamento de Alto Padrão!</strong></p><p>Este é o seu convite para experimentar a verdadeira definição de sofisticação. Apresentamos um <strong>apartamento de alto padrão</strong>, onde cada detalhe foi pensado para proporcionar uma experiência única de bem-estar. Com <strong>ambientes integrados</strong>, você encontra o equilíbrio perfeito entre modernidade e funcionalidade, onde a elegância e a praticidade se unem em um espaço de tirar o fôlego.</p><p>Imagine-se em um ambiente amplo e fluido, onde a <strong>sala de estar</strong>, <strong>jantar</strong> e <strong>cozinha gourmet</strong> se conectam, criando a sensação de continuidade e harmonia. Perfeito para quem busca praticidade sem abrir mão do estilo.</p><p><strong>Destaques do imóvel</strong>:</p><ul><li><strong>Design inovador e acabamentos refinados</strong>.</li><li><strong>Ambientes amplos e integrados</strong>, proporcionando leveza e conforto.</li><li><strong>Cozinha gourmet</strong> equipada com o que há de melhor.</li><li><strong>Varanda com vista panorâmica</strong> para <strong>Parque das Águas e cidade</strong>.</li><li><strong>Infraestrutura de primeira linha.</strong>.</li></ul><p><strong>Não perca a chance de viver com estilo e exclusividade</strong>. Agende sua visita e venha se encantar!</p>', 'Monte Verde', '{\"1\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-1\\/1.jpg\",\"2\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-1\\/2.jpg\",\"3\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-1\\/20.jpg\",\"4\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-1\\/17.jpg\",\"5\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-1\\/7.jpg\",\"6\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-1\\/13.jpg\",\"7\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-1\\/3.jpg\",\"8\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-1\\/4.jpg\",\"9\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-1\\/5.jpg\",\"10\":\"im