(69, 'Apartamento para venda no centro de São Lourenço - MG.', '<p><strong>🏡 Sofisticação e Conforto no Coração de São Lourenço - MG!</strong></p><p>Descubra este <strong>exclusivo apartamento</strong>, localizado no centro de <strong>São Lourenço - MG</strong>, a apenas <strong>500 metros do Parque das Águas</strong>.</p><p>✨ <strong>Diferenciais que encantam:</strong><br>✔️ <strong>Acabamento de alto padrão</strong> para máximo conforto e elegância.<br>✔️ <strong>Ampla planta</strong> com espaços bem distribuídos, arejados e iluminados.<br>✔️ <strong>Localização privilegiada</strong>, próximo a comércios, restaurantes e lazer.<br>✔️ <strong>Ideal para morar ou investir</strong> em uma das cidades mais charmosas do Sul de Minas.</p><p>💰 <strong>Oportunidade única para quem busca qualidade de vida e sofisticação!</strong></p><p>Agende sua visita e surpreenda-se! 📞📩</p>', 'Centro', '{\"1\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-damasceno-dutra\\/1.jpg\",\"2\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-damasceno-dutra\\/10.jpg\",\"3\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-damasceno-dutra\\/2.jpg\",\"4\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-damasceno-dutra\\/3.jpg\",\"5\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-damasceno-dutra\\/4.jpg\",\"6\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-damasceno-dutra\\/5.jpg\",\"7\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-damasceno-dutra\\/6.jpg\",\"8\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-damasceno-dutra\\/7.jpg\",\"9\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-damasceno-dutra\\/8.jpg\",\"10\":\"imoveis\\/ap-centro-fabio-ganan\\/edificio-damasceno-dutra\\/9.jpg\"}', 0, 2, 2, 6, 100, 890000.00, NULL, 0, 'selling', '2025-03-04 16:42:11', '2025-03-22 09:07:48', 'sale', NULL, 1, 6, 'day', 14, 'Srapid\\RealEstate\\Models\\Account', 'approved', '2025-04-18', 0, 1, '-22.116354', '-45.053004', 6),
(70, 'Lotes a Venda em São Lourenço Loteamento Villa Romana', '<article class=\"w-full text-token-text-primary focus-visible:outline-2 focus-visible:outline-offset-[-4px]\"><div class=\"m-auto text-base py-[18px] px-6\"><div class=\"mx-auto flex flex-1 text-base gap-4 md:gap-5 lg:gap-6 md:max-w-3xl\"><div class=\"group/conversation-turn relative flex w-full min-w-0 flex-col agent-turn @xs/thread:px-0 @sm/thread:px-1.5 @md/thread:px-4\"><div class=\"flex-col gap-1 md:gap-3\"><div class=\"flex max-w-full flex-col flex-grow\"><div class=\"min-h-8 text-message relative flex w-full flex-col items-end gap-2 whitespace-normal break-words text-start [.text-message+&amp;]:mt-5\"><div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\"><div class=\"markdown prose w-full break-words dark:prose-invert light\"><p><strong>Loteamento Villa Romana: Seu Novo Lar em Minas Gerais!</strong></p><p>O <strong>Loteamento Villa Romana</strong> está localizado em uma posição privilegiada, a apenas <strong>5 minutos de São Lourenço</strong> e <strong>5 minutos de Carmo de Minas</strong>, duas cidades encantadoras e com qualidade de vida incomparável. São Lourenço é famosa pelo seu turismo de bem-estar, com águas minerais e um clima ameno, ideal para quem busca tranquilidade e saúde. Já Carmo de Minas é conhecida pela produção de café de alta qualidade, com paisagens deslumbrantes e um ambiente acolhedor.</p><p>Com <strong>lotes a partir de 250m²</strong>, o Villa Romana oferece <strong>infraestrutura quase pronta</strong>, proporcionando todo o conforto e praticidade que você e sua família merecem. E o melhor: <strong>financiamento facilitado</strong>, com até <strong>47 vezes</strong> no plano curto ou até <strong>180 parcelas</strong> no plano longo, com <strong>entrada de 5,5%</strong> (dividida em até 3 vezes)! Você só começa a pagar o financiamento depois de quitar a entrada.</p><p><strong>Garanta já o seu lote no Villa Romana</strong> e viva a qualidade de vida que você sem