(90, 'Lindo sobrado para venda em São Lourenço - MG.', '<p><strong>🏡 Oportunidade Imperdível em São Lourenço – Casa com 90m² à Venda!</strong> 🌟</p><p>Está procurando o imóvel ideal para sua família? Esta <strong>casa de 90m²</strong> em São Lourenço é a chance que você esperava! Com um preço acessível e em uma localização incrível, ela oferece tudo o que você precisa para viver com conforto e praticidade.</p><p>🔑 <strong>Destaques do Imóvel:</strong></p><ul><li><strong>Duas suítes</strong> espaçosas, perfeitas para garantir privacidade e descanso.</li><li><strong>Sala ampla</strong> para você criar o ambiente perfeito para sua família.</li><li><strong>Cozinha funcional</strong>, ideal para preparar suas receitas favoritas com praticidade.</li><li><strong>Área de serviço</strong> separada, garantindo organização e funcionalidade no dia a dia.</li></ul><p>Com 90m² bem distribuídos, este imóvel oferece <strong>conforto e praticidade</strong> para o seu cotidiano, além de estar em uma localização estratégica em São Lourenço, perto de tudo o que você precisa!</p><p>Não deixe essa oportunidade passar! <strong>Agende sua visita agora e venha conhecer seu novo lar!</strong> 📞</p><p><strong>#CasaEmSãoLourenço #OportunidadeDeCompra #VendaImóvel #SuaCasaNova #ConfortoEPraticidade</strong></p>', 'Residencial Rio Verde II', '{\"1\":\"imoveis\\/sobrados\\/sobrado-residencial-rio-verde-ll\\/2.jpg\",\"2\":\"imoveis\\/sobrados\\/sobrado-residencial-rio-verde-ll\\/1.jpg\",\"3\":\"imoveis\\/sobrados\\/sobrado-residencial-rio-verde-ll\\/17.jpg\",\"4\":\"imoveis\\/sobrados\\/sobrado-residencial-rio-verde-ll\\/16.jpg\",\"5\":\"imoveis\\/sobrados\\/sobrado-residencial-rio-verde-ll\\/15.jpg\",\"6\":\"imoveis\\/sobrados\\/sobrado-residencial-rio-verde-ll\\/14.jpg\",\"7\":\"imoveis\\/sobrados\\/sobrado-residencial-rio-verde-ll\\/13.jpg\",\"8\":\"imoveis\\/sobrados\\/sobrado-residencial-rio-verde-ll\\/12.jpg\",\"9\":\"imoveis\\/sobrados\\/sobrado-residencial-rio-verde-ll\\/11.jpg\",\"10\":\"