(91, 'Lote para chácara a venda em Dom Viçoso - MG.', '<p><strong>🌳 Realize o Seu Sonho de Morar em uma Chácara em Dom Viçoso! 🌳</strong></p><p>🏞️ <strong>Lote de 1700m² com Vista Deslumbrante e Localização Privilegiada!</strong></p><p>Imagine ter um espaço amplo, com uma vista incrível, para construir a chácara dos seus sonhos em Dom Viçoso, uma cidade tranquila e encantadora! Este lote de 1700m² oferece todas as possibilidades para você criar um ambiente perfeito para o lazer e o descanso.</p><p>🌟 <strong>Destaques do Lote:</strong></p><ul><li><strong>Área Total de 1700m²</strong>: Perfeito para construir a chácara dos seus sonhos, com espaço para um jardim, pomar, área de lazer e muito mais!</li><li><strong>Linda Vista Panorâmica</strong>: Desfrute da paz e beleza da natureza ao seu redor, com uma vista privilegiada da cidade e das montanhas.</li><li><strong>Excelente Localização</strong>: Situado em uma região tranquila, com fácil acesso a todos os serviços e comércios da cidade, garantindo praticidade no seu dia a dia.</li><li><strong>Ideal para Moradia ou Investimento</strong>: Perfeito para quem busca um lugar calmo e aconchegante, ou até mesmo para quem deseja investir em um local promissor para o futuro.</li></ul><p>💎 <strong>A oportunidade que você esperava para construir a chácara dos seus sonhos!</strong> 💎</p><p>Não perca essa chance de investir em um terreno que oferece qualidade de vida, privacidade e uma vista de tirar o fôlego! Agende uma visita e venha conferir de perto essa oportunidade única.</p><p>📞 <strong>Entre em contato e faça sua proposta!</strong></p><p>&nbsp;</p>', 'Bocaina', '{\"1\":\"chacaras\\/lote-1700m-bocaina\\/17.jpg\"}', 0, NULL, NULL, NULL, 1700, 100000.00, NULL, 0, 'selling', '2025-03-09 11:38:36', '2025-03-18 01:23:37', 'sale', NULL, 1, 7, 'day', 14, 'Srapid\\RealEstate\\Models\\Account', 'approved', '2025-04-23', 0, 1, '-22.226597', '-45.127380', 5),
(92, 'Linda chácara para venda próximo a São Lourenço - MG.', '<p><strong>&nbsp;Chácara dos Sonhos a 15 Minutos de São Lourenço! 🌳</strong></p><p>🏡 <strong>3000m² de Natureza, Conforto e Tradição!</strong></p><p>Está em busca de um refúgio perfeito para relaxar, com a tranquilidade da natureza e o charme de uma casa aconchegante? Esta chácara a apenas 15 minutos de São Lourenço é o lugar ideal para você! Com uma linda vista, riacho nos fundos e muito mais, esse pedacinho do paraíso espera por você.</p><p>🌟 <strong>Destaques do Imóvel:</strong></p><ul><li><strong>Área Total de 3000m²</strong>: Pura natureza ao seu redor, com muito espaço para lazer, cultivo ou simplesmente para desfrutar de momentos de paz.</li><li><strong>Riacho nos Fundos</strong>: Um riacho tranquilo, que vai proporcionar ainda mais beleza e serenidade ao seu novo lar.</li><li><strong>Jardim Encantador</strong>: Ambientes ao ar livre cuidadosamente planejados para trazer charme e bem-estar.</li><li><strong>Casa Aconchegante</strong>: Com sala, 2 quartos e varanda em toda a extensão da casa — perfeita para relaxar e apreciar a paisagem.</li><li><strong>Fogão a Lenha</strong>: Um toque de rusticidade e aconchego para os dias mais frios, criando o clima perfeito para momentos em família.</li></ul><p>🌿 <strong>Viva o melhor da natureza com o conforto de um lar!</strong> 🌿<br>A apenas 15 minutos de São Lourenço, você vai aproveitar a tranquilidade do campo, sem abrir mão da proximidade da cidade. Ideal para quem busca qualidade de vida, contato com a natureza e momentos de descanso e lazer.</p><p>📞 <strong>Agende sua visita e venha conhecer pessoalmente esse paraíso!</strong></p><p>&nbsp;</p><p>&nbsp;</p>', 'Campos', '{\"1\":\"chacaras\\/chacara-no-bairro-dos-campos\\/img-20240301-wa0033.jpg\",\"2\":\"chacaras\\/chacara-no-bairro-dos-campos\\/img-20240301-wa0027.jpg\",\"3\":\"chacaras\\/chacara-no-bairro-dos-campos\\/img-20240301-wa0028.jpg\",\"4\":\"chacaras\\/chacara-no-bairro-dos-campos\\/img-202409