(100, 'Lotes a Venda em São Lourenço MG', '<p style=\"color:rgb(0,0,0);font-style:normal;font-weight:400;text-decoration:none;word-spacing:0px;\"><strong>Oportunidade Imperdível! Terrenos à Venda no Residencial Rio Verde II - São Lourenço/MG</strong></p><p style=\"color:rgb(0,0,0);font-style:normal;font-weight:400;text-decoration:none;word-spacing:0px;\">Está procurando o local perfeito para investir? Apresento este terreno à venda no Residencial Rio Verde II (Sonda), em São Lourenço/MG. Com 200 metros quadrados cada, este terreno possui uma excelente topografia, ideal para a construção de empreendimentos como apartamentos ou até mesmo um prédio.</p><p style=\"color:rgb(0,0,0);font-style:normal;font-weight:400;text-decoration:none;word-spacing:0px;\"><strong>Destaques:</strong></p><ul><li style=\"color:rgb(0,0,0);font-style:normal;font-weight:400;text-decoration:none;word-spacing:0px;\">Localização privilegiada, garantindo uma vista e ventilação incríveis.</li><li style=\"color:rgb(0,0,0);font-style:normal;font-weight:400;text-decoration:none;word-spacing:0px;\">Região em crescimento, com grande potencial de valorização.</li></ul><p style=\"color:rgb(0,0,0);font-style:normal;font-weight:400;text-decoration:none;word-spacing:0px;\">Não perca essa oportunidade de realizar um excelente negócio em um dos melhores bairros da cidade!</p><p style=\"color:rgb(0,0,0);font-style:normal;font-weight:400;text-decoration:none;word-spacing:0px;\">Valor R$ 110.000,00.</p><p style=\"color:rgb(0,0,0);font-style:normal;font-weight:400;text-decoration:none;word-spacing:0px;\">Entre em contato e agende sua visita:</p><p style=\"color:rgb(0,0,0);font-style:normal;font-weight:400;text-decoration:none;word-spacing:0px;\">&nbsp;</p>', NULL, '{\"1\":\"accounts\\/b2b4b535-5e3a-4c4c-a00d-de6dbf1e85d1.jpeg\",\"2\":\"accounts\\/74935383-94ef-403f-97b8-9c33ee58c1f3.jpeg\",\"3\":\"accounts\\/1c40ef0c-1657-44b2-a538-df3b68751adc.jpeg\",\"4\":\"accounts\\/a5df4cc3-5cff-41f5-81eb-03ce1b74bcdb.jpeg\",