(102, 'Linda Casa com terraço em São Lourenço MG', '<p>Linda Casa à Venda - Conforto, Espaço e Lazer!</p><p>Essa é a oportunidade que você estava esperando! Uma linda casa, perfeita para sua família, com 3 quartos, sendo 1 suíte, proporcionando todo o conforto e privacidade que você merece. A casa conta ainda com um banheiro social, uma ampla sala e cozinha, além de uma varanda aconchegante para momentos de lazer.</p><p>O quintal é um verdadeiro refúgio! Todo gramado, com uma árvore frutífera que traz charme e tranquilidade ao ambiente. E o melhor: um terraço grande com banheiro exclusivo, churrasqueira e fogão a lenha, ideal para receber amigos e familiares em grande estilo!</p><p>A casa possui garagem coberta para 1 carro e mais 3 vagas descobertas, oferecendo praticidade no seu dia a dia. Além disso, ela é toda preparada para água quente, garantindo mais conforto e praticidade para sua rotina.</p><p>Com uma localização excelente, próxima a tudo o que você precisa, esta casa oferece o equilíbrio perfeito entre conforto, lazer e praticidade.</p><p>Não perca essa chance única de viver em um lugar especial! Agende sua visita e venha conhecer o seu novo lar!</p>', 'Santa Monica', '{\"1\":\"accounts\\/c474809b-8a4b-4904-9535-95d50cac4db6.jpeg\",\"2\":\"accounts\\/5b7a6706-4890-4c04-a3f9-8657095d1606.jpeg\",\"3\":\"accounts\\/f6388375-034c-41b6-961f-9a3a78b98114.jpeg\",\"4\":\"accounts\\/1839fe5e-60f6-4fda-b217-742a69d87b44.jpeg\",\"5\":\"accounts\\/6d975dfb-2d90-4bfd-ac72-58308f7d7525.jpeg\",\"6\":\"accounts\\/6f5e2510-72a6-49fe-a9ff-1ffe79f9c38b.jpeg\",\"7\":\"accounts\\/0f07f18c-e3d0-4843-9106-b986da047c81.jpeg\",\"8\":\"accounts\\/a180d1db-548f-4c2b-b292-21bd2c2a3214.jpeg\",\"9\":\"accounts\\/0959a98b-5f04-4d6d-bef4-af47cadacdf7.jpeg\",\"10\":\"accounts\\/2f8040a9-916a-481f-905b-23e67665674f.jpeg\",\"11\":\"accounts\\/f7d197ba-ba0b-4e8b-a01d-d6e7d63b5c9d.jpeg\",\"12\":\"accounts\\/990eb004-03d7-4490-9983-3bdbeedd86a1.jpeg\",\"13\":\"accounts\\/f8db86ab-2513-4a4f-8a6