(104, 'Lotes em São Lourenço Loteamento Parque da Mata', '<p>🌳 Loteamento Parque da Mata - O Seu Refúgio em São Lourenço-MG! 🌳</p><p>Imagine viver em um lugar de paz, sossego e uma vista deslumbrante. O Loteamento Parque da Mata oferece tudo isso e muito mais! Localizado em São Lourenço-MG, esse é o lugar perfeito para quem busca qualidade de vida, tranquilidade e o privilégio de morar em um ambiente rodeado pela natureza.</p><p>🔑 Infraestrutura Completa: Já com toda a infraestrutura pronta, o Parque da Mata está pronto para você construir o seu sonho, com ruas pavimentadas, saneamento básico e tudo o que você precisa para viver com conforto.</p><p>🏡 Últimas Unidades Disponíveis! Não perca a oportunidade de garantir o seu espaço neste paraíso natural.</p><p>💰 Facilidade no Pagamento: Entrada de apenas R$ 2.000 e saldo em até 180 vezes! A realização do seu sonho está mais perto do que nunca.</p><p>🔑 Venha conhecer o Parque da Mata e dê o primeiro passo para o seu novo lar! 🌳</p><p>Entre em contato e garanta o seu lote hoje mesmo!</p>', 'Loteamento Parque da Mata', '{\"1\":\"accounts\\/6f137853-af9d-45b3-9079-2c0a14d87548.jpeg\",\"2\":\"accounts\\/6b7e952f-997c-47a0-9508-a9b3a290ca24.jpeg\",\"3\":\"accounts\\/img-3661.jpeg\"}', 22, NULL, NULL, NULL, NULL, 105000.00, NULL, 0, 'selling', '2025-03-12 22:20:03', '2025-03-18 12:54:01', 'sale', NULL, 1, 6, 'day', 16, 'Srapid\\RealEstate\\Models\\Account', 'approved', '2025-04-26', 0, 0, '22.104388', '45.072742', 3),
(105, 'Casa alto padrão para venda em São Lourenço  - MG.', '<p>Casa de Alto Padrão com 270m² em Localização Privilegiada</p><p>Apresentamos essa magnífica casa de alto padrão, com 270 metros quadrados de puro luxo e conforto. Ideal para quem busca sofisticação e qualidade de vida, esse imóvel oferece:</p><p>Sala de 2 Ambientes: Perfeita para recepcionar com elegância, integrada de maneira fluida aos demais espaços da casa.<br>3 Suítes Internas: Sendo uma delas com hidromassagem, proporcionando um ambiente exclusivo de relaxamento e bem-estar.<br>1 Banheiro Social: Com acabamentos de alto padrão, atendendo com estilo e funcionalidade.<br>1 Suíte Externa de 60m²: Com total privacidade, ideal para hóspedes ou para quem busca um espaço separado.<br>Sauna: Perfeita para momentos de descontração e relaxamento.<br>Piscina e Ducha: Uma área para lazer completa, perfeita para os dias mais quentes.<br>Área Gourmet Completa: Com fogão a lenha, churrasqueira e forno de pizza, para celebrar momentos inesquecíveis com amigos e família.<br>Salão Versátil: Um grande salão que pode ser utilizado tanto para festas quanto para jogos, atendendo às suas necessidades de diversão e convivência.<br>Vaga para até 3 Carros: Com amplo espaço de garagem para acomodar com conforto e segurança seus veículos.<br>Esse imóvel é a combinação perfeita de sofisticação, conforto e lazer, em uma das melhores localizações. Não perca a oportunidade de viver com o luxo e a qualidade que você merece!</p><p>Agende uma visita e venha conhecer pessoalmente essa verdadeira obra-prima da arquitetura.</p>', 'Vale Do Pinheiros', '{\"1\":\"accounts\\/photo-2025-03-14-18-24-10-4.jpg\",\"2\":\"accounts\\/photo-2025-03-14-18-24-08-5.jpg\",\"3\":\"accounts\\/photo-2025-03-14-18-24-09-2.jpg\",\"4\":\"accounts\\/photo-2025-03-14-18-24-08.jpg\",\"5\":\"accounts\\/photo-2025-03-14-18-24-08-3.jpg\",\"6\":\"accounts\\/photo-2025-03-14-18-24-07-4.jpg\",\"7\":\"accounts\\/photo-2025-03-14-18-24-07-3.jpg\",\"8\":\"accounts\\/p