(107, 'Linda chácara para venda próximo a São Lourenço - MG.', '<p>🌿 <strong>Sua Oportunidade de Ter um Refúgio no Campo!</strong> 🌿</p><p>Imagine-se vivendo em um local tranquilo, cercado pela natureza, com todo o conforto e privacidade que você merece. Apresentamos uma <strong>chácara de 2100m²</strong> com <strong>mata lindeira</strong> preservada, proporcionando uma sensação única de exclusividade.</p><p>✨ <strong>Destaques do Imóvel</strong>:</p><ul><li><strong>Privacidade total</strong>: A estrada fica escondida pela mata, garantindo o seu descanso sem interrupções.</li><li><strong>Riacho encantador</strong>: Um pequeno riacho corta os fundos da chácara, trazendo um toque especial de natureza.</li><li><strong>Topografia plana</strong>: Ideal para construção, com total flexibilidade para o que você desejar criar.</li><li><strong>Proximidade com a cidade</strong>: Localizada a menos de 30 minutos de São Lourenço, você estará perto de tudo o que precisa, mas com a paz e serenidade do campo.</li></ul><p>🔑 <strong>Pronto para construir o seu lar dos sonhos!</strong></p><p>Não perca essa chance de viver no meio da natureza, sem abrir mão da praticidade e da proximidade com a cidade. Entre em contato agora e agende uma visita!</p><p>🌱 <strong>Chácara disponível para venda – o seu pedaço de paraíso te espera!</strong> 🌱</p>', 'Bocaina', '{\"1\":\"chacaras\\/lote-2100m-condominio-pinhao-grande\\/img-20250224-wa0041-1.jpg\",\"2\":\"chacaras\\/lote-2100m-condominio-pinhao-grande\\/img-20250319-wa0014.jpg\",\"3\":\"chacaras\\/lote-2100m-condominio-pinhao-grande\\/img-20250224-wa0050.jpg\",\"4\":\"chacaras\\/lote-2100m-condominio-pinhao-grande\\/img-20250224-wa0049.jpg\",\"5\":\"chacaras\\/lote-2100m-condominio-pinhao-grande\\/img-20250224-wa0048.jpg\",\"6\":\"chacaras\\/lote-2100m-condominio-pinhao-grande\\/img-20250224-wa0047.jpg\",\"7\":\"chacaras\\/lote-2100m-condominio-pinhao-grande\\/img-20250224-wa0046.jpg\",\"8\":\"chacaras\\/lote-2100m-condominio-pinhao-grande\\/img-20250224-wa0044.jpg\",\"9\":\"chacaras\\/lote-2100m-condominio-pinhao-grande\\/img-20250224-wa0043.jpg\"}', 0, NULL, NULL, NULL, 2100, 170000.00, NULL, 0, 'selling', '2025-03-19 18:39:02', '2025-03-20 14:53:03', 'sale', NULL, 1, 7, 'day', 14, 'Srapid\\RealEstate\\Models\\Account', 'approved', '2025-05-03', 0, 1, '-22.238799', '-45.125985', 5),
(108, 'Linda chácara para venda há 10 minutos de São Lourenço - MG.', '<p>🏡✨ <strong>Sua Chácara dos Sonhos no Condomínio de Chácaras Recanto dos Carvalhos!</strong> ✨🌿</p><p>Já imaginou viver cercado pela natureza, com toda infraestrutura pronta para construir e morar? Essa é a sua chance!</p><p>📍 <strong>Localização privilegiada</strong> no Condomínio Recanto dos Carvalhos, ao lado da Pousada Recantos dos Carvalhos.<br>🌳 <strong>1.000m² de espaço</strong> para você aproveitar como quiser<br>🚰 <strong>Infraestrutura completa</strong> – água, luz e acesso facilitado<br>🌿 <strong>Contato direto com a natureza</strong>, tranquilidade e qualidade de vida</p><p>O refúgio perfeito para quem busca paz, conforto e um cantinho especial para chamar de lar. 🏡💚</p><p>📞 Entre em contato e venha conhecer esse paraíso!</p>', 'Recanto dos Carvalhos', '{\"1\":\"chacaras\\/chacara-recanto-dos-carvalhos\\/img-20250320-wa0024.jpg\",\"2\":\"chacaras\\/chacara-recanto-dos-carvalhos\\/img-20250320-wa0023.jpg\",\"3\":\"chacaras\\/chacara-recanto-dos-carvalhos\\/img-20250320-wa0021.jpg\",\"4\":\"chacaras\\/chacara-recanto-dos-carvalhos\\/img-20250320-wa0022.jpg\",\"5\":\"chacaras\\/chacara-recanto-dos-carvalhos\\/imagem-do-whatsapp-de-2025-03-20-as-193201-5a6358e9.jpg\",\"6\":\"chacaras\\/chacara-recanto-dos-carvalhos\\/imagem-do-whatsapp-de-2025-03-20-as-193200-d3880966.jpg\",\"7\":\"chacaras\\/chacara-recanto-dos-carvalhos\\/imagem-do-whatsapp-de-2025-03-20-as-193200-c960c8ce.jpg\"}', 0, NULL, NULL, NULL, 1000, 120000.00, NULL, 0, 'selling', '2025-03-21 15:17:11', '2025-03-21 15:34:32', 'sale', NULL, 1, 9, 'day', 14, 'Srapid\\RealEstate\\Models\\Account', 'approved', '2025-05-05', 0, 1, '-22.150515', '-45.009570', 1),
(110, 'Chácara Recanto dos Mendes', '<p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\"><span style=\"font-family:\'Times New Roman\';font-kerning:none;font-size:19.00px;font-style:normal;font-weight:normal;\">Descubra o Refúgio Perfeito para Seu Fim de Semana ou Evento Especial! 🌿🏡✨</span></p><p style=\"-webkit-text-stroke:#000000;font:12.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;min-height:13.8px;\"><br>&nbsp;</p><p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\"><span style=\"font-family:\'Times New Roman\';font-kerning:none;font-size:19.00px;font-style:normal;font-weight:normal;\">Seja para um final de semana relaxante, uma confraternização inesquecível ou um evento especial, a Chácara Recanto dos Mendes é o lugar ideal!</span></p><p style=\"-webkit-text-stroke:#000000;font:12.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;min-height:13.8px;\"><br>&nbsp;</p><p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\"><span style=\"font-family:\'Times New Roman\';font-kerning:none;font-size:19.00px;font-style:normal;font-weight:normal;\">🌳 Em meio à natureza, você encontra conforto e lazer em um ambiente exclusivo:</span></p><p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\"><span style=\"font-family:\'Times New Roman\';font-kerning:none;font-size:19.00px;font-style:normal;font-weight:normal;\">✅ 8 acomodações, com 3 quartos, sendo 1 suíte</span></p><p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\"><span style=\"font-family:\'Times New Roman\';font-kerning:none;font-size:19.00px;font-style:normal;font-weight:normal;\">✅ Cozinha ampla e totalmente equipada</span></p><p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\"><span style=\"font-family:\'Times New Roman\';font-kerning:none;font-size:19.00px;font-style:normal;font-weight:normal;\">✅ Sala aconchegante com vista para o jardim</span></p><p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\"><span style=\"font-family:\'Times New Roman\';font-kerning:none;font-size:19.00px;font-style:normal;font-weight:normal;\">✅ Área gourmet completa para seu churrasco</span></p><p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\"><span style=\"font-family:\'Times New Roman\';font-kerning:none;font-size:19.00px;font-style:normal;font-weight:normal;\">✅ Piscina refrescante para aproveitar com a família e amigos</span></p><p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\"><span style=\"font-family:\'Times New Roman\';font-kerning:none;font-size:19.00px;font-style:normal;font-weight:normal;\">💰 Diárias a partir de R$ 300,00 + taxa de limpeza R$ 250,00.</span></p><p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\"><span style=\"font-family:\'Times New Roman\';font-kerning:none;font-size:19.00px;font-style:normal;font-weight:normal;\">Consulte condições.</span></p><p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\">&nbsp;</p><p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\"><span style=\"font-family:\'Times New Roman\';font-kerning:none;font-size:19.00px;font-style:normal;font-weight:normal;\">📍 Fique cercado pelo verde, respire ar puro e viva momentos inesquecíveis!</span></p><p style=\"-webkit-text-stroke:#000000;font:12.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;min-height:13.8px;\">&nbsp;</p><p style=\"-webkit-text-stroke:#000000;font:19.0px \'Times New Roman\';margin:0.0px 0.0px 12.0px;\"><span style=\"font-family:\'Times New Roman\';font-kerning:none;font-size:19.00px;font-style:normal;font-weight:normal;\">📲 Reserve agora e garanta seu descanso no paraíso!</span></p><p><br>&nbsp;</p>', NULL, '[\"accounts/cb01c492-ca85-4399-bc8f-4184a930ecba.jpeg\",\"accounts/54fdb1bd-eef3-4a1e-b0ce-bd75122eae3c.jpeg\",\"accounts/b4645553-691d-43a1-9ccc-ccf7c6c9169a.jpeg\",\"accounts/b0d860b2-6132-4594-8315-e9c29f7865ad.jpeg\",\"accounts/bc2da1bf-6e97-47da-8881-c8aa0e5bd555.jpeg\",\"accounts/586f49c6-d163-4bde-9ebb-307e1114c9bb.jpeg\",\"accounts/ed6f50cc-abad-4c91-ba5c-fe1459ac3c16.jpeg\",\"accounts/img-20241119-wa0020.jpeg\",\"accounts/img-20241119-wa0026.jpeg\",\"accounts/bacc694b-e743-4b08-8e3a-3a5c369eaa57.jpeg\"]', 0, 3, 3, 1, 2000, 1500.00, NULL, 0, 'not_available', '2025-03-22 00:10:07', '2025-03-22 00:10:07', 'rent', 'Chácara para locação de eventos, finais de semana e confraternizações.', 1, 7, 'day', 14, 'Srapid\\RealEstate\\Models\\Account', 'pending', '2025-05-06', 1, 0, '-22.239452', '-45.125796', 0);
