(148, 'theme-site-rapido-seo_description', 'Encontre o seu imóvel aqui', NULL, NULL),
(149, 'theme-site-rapido-about-us', 'Com mais de uma década de experiência no mercado imobiliário, a Rodrigo Lima Corretor de Imóveis (CRECI 46623 MG)  e agora com a Imobiliária Rodrigo Lima Negócios Imobiliários (CRECI MGJ 9168) se destaca como referência em São Lourenço e região. Nossa missão é realizar o sonho da casa própria e proporcionar os melhores investimentos para nossos clientes.', NULL, NULL),
